       Genre      :   Comedy/Romance          


 Ramana is the only son of local MLA Akula    
 Appa Rao. He falls in love with his college- 
 mate Lavanya. Ramana wants to propose her,   
 and at the same time, he comes to know that  
 she wanted to pursue higher education and    
 needs five years time. In order to wait for  
 her, Ramana starts failing in his degree     
 exam for five years. Lavanya returns to the  
 college as lecturer and surprised to notice  
 Ramana in the class.                         
 Then Ramana expresses his love to Lavanya    
 and latter tells him to get through the      
 examination first.                           

